import React from 'react';

const Search = () => {
    return (
        <div>
            <div className="bg-image"
                 style="background-image: url('https://images.unsplash.com/photo-1504674900247-0877df9cc836?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1170&q=80');
            height: 100vh">
            </div>
        </div>
    );
};

export default Search;
